import React from "react";
import "./Carousel.css";
import { images } from "../Components/CarouselData";
function Carousel() {
  return (
    <div className="Carousel">
      <div className="carouselInner">
        <img src="{images[0].img}" />
      </div>
    </div>
  );
}
export default Carousel;
